INSERT INTO cursos (id, url_documento, title, content, link, creado_por, creado_fecha, modificado_por, modificado_fecha, autorizado, autorizado_por, autorizado_fecha)
VALUES
  (1, 'images/cursos/1.svg', 'Diseño y formulación de proyectos catastrales', '<p>El objetivo de este curso es dar a conocer las herramientas metodológicas con ejemplos de casos prácticos de la formulación de proyectos en el sector público, en especial aquellos dirigidos a diseñar y formular proyectos catastrales.</p><p><strong class="font-acto text-primary">*Incluye Certificado</strong></p>', 'https://wa.link/koj026', 'Migración', NOW(), 'Migración', NOW(), '1', 'Migración', NOW()),
  (2, 'images/cursos/2.svg', 'Levantamiento catastral en el marco de la Ley 28294', '<p>Este curso tiene el objetivo de brindar las herramientas necesarias para que el participante adquiera los conocimientos del proceso de levantamiento catastral usando la normativa vigente y las metodologías adecuadas para su elaboración desde una visión eminentemente práctica.</p><p><strong class="font-acto text-primary">*Incluye Certificado</strong></p>', 'https://wa.link/koj026', 'Migración', NOW(), 'Migración', NOW(), '1', 'Migración', NOW()),
  (3, 'images/cursos/3.svg', 'ArcGIS Pro Aplicado al Catastro', '<p>Este curso tiene el objetivo de dar a conocer el entorno del software e identificar las herramientas necesarias para que el participante esté en la capacidad de manejar el componente geométrico y la temática de la información catastral, a fin de generar nuevos elementos de información y establecer una simbología de acuerdo a una clasificación temática o espacial.</p><p><strong class="font-acto text-primary">*Incluye Certificado</strong></p>', 'https://wa.link/koj026', 'Migración', NOW(), 'Migración', NOW(), '1', 'Migración', NOW());
